<SUMMARY>
A multiplicative utility model for responder behavior in which the base monetary payoff (split_self) is scaled by a fairness adjustment. The fairness benchmark, computed as the token-proportionate share of the combined earning (fair_share), is compared to the actual offer via a relative deviation (r). The utility for accepting an offer is given by U_accept = gamma × split_self × (1 + lambda_param × r), where gamma and lambda_param (with bounds [0,10] and [-10,10], respectively) are the only learnable parameters.

